import React from 'react';

const TrackList = ({ tracks, onPlay }) => {
    return (
        <div>
            {tracks.map((track, index) => (
                <div key={track.id.videoId} style={{ margin: '10px 0' }}>
                    <span>{track.snippet.title}</span>
                    <button style={{ marginLeft: '10px' }} onClick={() => onPlay(index)}>Play</button>
                </div>
            ))}
        </div>
    );
};

export default TrackList;
